import React from 'react';
import './SalesByCountryTable.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGlobe } from '@fortawesome/free-solid-svg-icons';

const SalesByCountryTable = () => {
  const data = [
    { country: "United State", sales: 2500, value: "$230,900", bounce: "29.9%", flag: "ðŸ‡ºðŸ‡¸" },
    { country: "Germany", sales: 3900, value: "$440,000", bounce: "40.22%", flag: "ðŸ‡©ðŸ‡ª" },
    { country: "Great Britain", sales: 1400, value: "$190,700", bounce: "23.44%", flag: "ðŸ‡¬ðŸ‡§" },
    { country: "Brasil", sales: 562, value: "$143,960", bounce: "32.14%", flag: "ðŸ‡§ðŸ‡·" },
  ];

  return (
    <div className="sales-table-container">
      <div className="sales-table-header">
        <div className="icon-container">
          <FontAwesomeIcon icon={faGlobe} className="icon" />
        </div>
        <h3>Sales by Country</h3>
      </div>
      <table className="sales-table">
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td className="flag-column">{item.flag}</td>
              <td>
                <span className="label">Country:</span> {item.country}
              </td>
              <td>
                <span className="label">Sales:</span> {item.sales}
              </td>
              <td>
                <span className="label">Value:</span> {item.value}
              </td>
              <td>
                <span className="label">Bounce:</span> {item.bounce}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default SalesByCountryTable;
